INSERT INTO `Options` VALUES
(1,'Ablative Coat ([quantity])','Your robot is now covered with a special coat that takes 3 points of damage from any direction or source. Discard after your robot takes a total of 3 points of damage.','When you die you will lose this option as it tries to take damage',1,3,-1,-1,95,0,9),
(2,'Abort Switch','Instead of revealing a program card- ignore it and draw a new one randomly from the deck. Once switch is activated- draw program cards randomly from the deck for the remainder of the turn.','',9,-2,0,-1,98,1,0),
(3,'Big Gun ([quantity])','You may fire the Big Gun instead of firing your robot\'s main laser. The Big Gun causes 2 points of damage in addition to pushing your robot back 1 square.','',8,5,2,-1,9,2,1),
(4,'Big Jet','When activated- your robot flies forward 8 squares before landing and executing its program. The Big Jet allows you to fly over walls and other robots. Your robot takes 2 points of damage when it lands.','',2,1,0,-1,47,3,5),
(5,'Bio Option','When you receive this option- immediately take another option and place it on Bio Option. Each time your robot powers down- discard the other option and draw another. If you exchange either Bio Option or the other option to prevent damage- discard both options (does not apply if Bio Option variant is used).','',0,-1,0,-1,10,9,1),
(6,'Brakes','Your robot may now choose to move zero when it is executing a Move 1. Priority is that of the Move 1.','This option is Turn Programmed- not Runtime',2,-2,0,-1,11,3,8),
(7,'Bridge Layer ([quantity])','When activated- place a bridge token in the square in front of your robot. Treat robots moving over this square as if they were moving over open floor.','',2,2,0,9,21,4,7),
(8,'Buzz Bomb ([quantity])','When activated (and each turn until the buzz bomb explodes)- take five program cards and use them to program the buzz bomb. If the bomb hits a robot or a wall- the bomb explodes.','',0,3,4,-1,76,6,0),
(9,'Circuit Breaker','Any time your robot ends a turn with 3 or more points of damage- it will automatically begin the next turn powered down.','',1,-2,3,-1,14,0,9),
(10,'Conditional','After programming all five registers- you may place one of the remaining program cards on this option. This conditional program may then be substituted for any program card in your registers before cards for that phase are revealed. Discard the conditional program at the end of the turn- but keep this option.','',9,-1,0,-1,41,1,0),
(11,'Converter','When your robot is damaged- place an energy counter on this option instead of taking a damage chit. When your robot executes its next movement card- remove an energy counter and move 1 extra square. If there are more than two counters on this option at any time- it explodes for 2 points of damage.','',1,-1,2,-1,66,0,7),
(12,'Crab Legs','You may place a Move 1 in the same register as a Rotate Left or Rotate Right card- and during that phase your robot will move 1 square to the left or right- respectively- without rotating.','',7,-1,0,-1,6,3,6),
(13,'Double Barrel Laser','Your robot\'s main laser has been modified to fire two shots. May be used with {Fire Control} and/or {High Power Laser.}','',1,-1,1,-1,33,7,9),
(14,'Drone Launcher ([quantity])','You may launch a drone instead of firing your robot\'s main laser. Drones fly 3 squares toward the target robot each register phase- and explode for 2 points of damage in addition to pushing the target robot back 1 square. Priority of drones: 880- 870- 860.','',8,3,2,-1,44,2,0),
(15,'Dual Processor','You may place both a movement and a rotate program card in a single register.When executing the movement card- move one square less and then execute the rotate card. If the rotate card is a U-Turn- move two squares less.','',7,-1,0,-1,25,3,5),
(16,'Extra Memory ([quantity])','Your robot receives one extra program card per turn. This option does not prevent your robot from being destroyed when it has reached 10 points of damage.','',1,1,0,-1,89,0,9),
(17,'Fire Control','You have targeting control of your robot\'s main laser. When scoring a point of damage- you may choose to use the damage to lock a register or destroy a particular option.','',9,-1,0,-1,72,7,0),
(18,'Flywheel','After programming all five registers- you may place one of the remaining movement cards on this option. In a subsequent turn that card may be added to the program cards dealt to you. For example- this gives an undamaged robot 10 program cards (9 normal and 1 from the flywheel).','',5,-1,0,-1,95,6,8),
(19,'Fourth Gear','Your robot may now choose to move forward 4 squares when it is executing a Move 3. Priority is that of the Move 3.','This option is Phase Programmed- not Runtime',2,-2,0,-1,56,1,8),
(20,'Frog Legs','You may now treat your robot as if it were flying when it is executing a Move 2 or Move 3. This option cannot be activated while your robot is flying.','This option is Phase Programmed- not Runtime',2,-2,0,-1,95,1,6),
(21,'Goo Dropper ([quantity])','When activated- place a goo token in your robots square. If a robot passes over or stops on the goo- the robot cannot leave that square until it attempts to move a total of four squares in any direction.','',2,3,0,9,7,4,4),
(22,'Gyroscopic Stabilizer','On any turn you choose to activate this option- your robot is not rotated by gears or conveyor belts.','',4,-2,0,-1,49,6,9),
(23,'High Power Laser','Your robot\'s main laser has been modified to shoot through one wall or robot to reach a target robot. If you shoot through a robot- that robot also receives damages. May be used with {Fire Control} and/or {Double Barrel Laser}.','',1,-2,0,-1,24,7,8),
(24,'Homing Device','1) You may place a homing device token on a target robot instead of firing your robot\'s main laser. 2) When activated- ignore your hand and move forward 3 squares during each register phase if doing so will bring you closer to the target robot. Otherwise- rotate right.','',8,-1,0,-1,75,9,1),
(25,'Interceptor','You may place an intercept token on a target robot instead of firing your robot\'s main laser. After cards are dealt on subsequent turns- you may choose to exchange cards with the player whose robot has your intercept token. Take the intercept token back.','',8,-1,0,-1,3,2,1),
(26,'Mechanical Arm','Any time your robot ends a register phase on one of the four squares bordering a checkpoint- it may use the mechanical arm to \"tag\" the checkpoint. A wall will block the arm- but another robot on the checkpoint will not.','This option is Enabled or disabled for Each Phase- not Runtime.',2,-2,0,-1,89,1,5),
(27,'Mine Layer ([quantity])','When activated- place a mine token in your robot\'s square. If a robot passes over or stops on the mine- the mine explodes.','',2,3,4,9,35,4,7),
(28,'Mini Howitzer ([quantity])','You now have the option of firing a mini howitzer instead of your main laser. The mini howitzer will cause 1 point of damage in addition to pushing the target robot 1 square away from you. After 5 shots- discard this option.','',8,5,0,-1,10,2,5),
(29,'Missile Launcher ([quantity])','You may launch a missile instead of firing your robot\'s main laser. When launched- place the missile in your robot\'s square. During each subsequent phase- move the missile forward 2 squares. Priority of missiles: 735- 725- 715.','',8,3,4,-1,46,2,1),
(30,'Option Damping Field','When activated- all options(except this one) within a 3-square radius of your robot are deactivated or cannot be used. Devices already released by options continue to function normally.','',2,-2,0,-1,97,6,7),
(31,'Overload Override','You may place two program cards in a single register and execute both in that register phase- or you may leave a register unprogrammed. Your robot takes a point of damage each time this option is used.','',7,-2,0,-1,48,3,5),
(32,'Portable Teleporter ([quantity])','When activated- place a portable teleporter token in your robot\'s square. Treat the portable teleporter as if it were a teleporter board element.','',2,1,0,9,49,4,4),
(33,'Power Down Shield','When your robot powers down- a shield comes out on each of the robot\'s four sides. Each shield protects the robot from 1 point of damage per register phase. When the robot powers up- the shields retract.','',1,-2,0,-1,1,0,8),
(34,'Presser Beam','You now have the option of firing a presser beam instead of your robot\'s main laser. The presser beam will push a target robot 1 squares away from you.','',8,-1,0,-1,60,2,5),
(35,'Proximity Mine ([quantity])','When activated- place a proximity mine token in your robot\'s square. If a robot passes within 1 square of the mine- the mine explodes.','',2,3,4,9,94,4,5),
(36,'Radio Control','You now have the option of using a radio control beam instead of your robot\'s main laser. The radio control beam can only target a robot within 6 squares- and it replaces that robot\'s entire program with a copy of your robot\'s program. In cases of card priority- the target robot moves after your robot.','',8,-2,0,-1,92,2,5),
(37,'Ramming Gear','When your robot pushes another robot- that robot receives a point of damage in addition to being pushed. Even if the target robot can\'t be moved- it still receives a point of damage.','',1,-2,0,-1,80,8,9),
(38,'Rear Laser','Your robot has a rear-firing laser in addition to its main laser.','The turret will also affect the direction of the rear laser',1,-2,0,-1,20,8,9),
(39,'Recompile','You may receive a new hand once per turn before your robot is programmed. Your robot takes a point of damage after you receive the new hand.','Your robot will take 1 point of damage BEFORE you receive your new hand.  You must Enable Recompile and submit your hand and you will receive a new hand.',10,-2,1,-1,63,6,8),
(40,'Re-engineering Unit','When your robot pushes another robot- you may exchange this option for an option on the other robot.','',8,-1,0,-1,52,1,0),
(41,'Reflector ([direction])','When your robot is hit by a laser- your robot takes damages and the laser is reflected back to its source. Program the direction the reflector faces by turning this card to indicate front- back- right or left.','',6,-2,0,-1,74,6,8),
(42,'Retro-Rockets ([quantity])','When activated- your robot flies back 2 squares per fuel token before executing its program.','',2,3,0,-1,13,3,5),
(43,'Reverse Gears','Your robot may now choose to back up 2 squares when it is executing a Back-Up. Priority is that of the Back-Up.','This option is Turn Programmed- not Runtime',2,-2,0,-1,44,1,8),
(44,'Robo Copter ([quantity])','Program by placing an unused movement card on this option. During each register phase- execute the movement card and then execute your program card. While robo copter is active- your robot is flying.','This option may only be used once',4,1,0,-1,78,6,7),
(45,'Scrambler','You now have the option of firing a scrambler instead of your robot\'s main laser. The scrambler allows you to replace the next programmed card of a target robot with a random one from the deck. This option cannot be used on the fifth register phase.','',8,-2,0,-1,60,2,5),
(46,'Scrambler Bomb ([quantity])','When activated- place a scrambler token in your robot\'s square. At the beginning of the next turn- all robots within 6 squares of the bomb execute program cards at random for the entire turn.','',2,1,0,9,67,4,4),
(47,'Self-Destruct ([quantity])','Program by placing this card in a register. The option will be destroyed at the beginning of that register phase. If destroyed or exchanged to prevent damage- this option explodes.','',3,1,16,-1,54,5,8),
(48,'Shield ([direction])','Your robot now has a shield that protects the robot from 1 point of damage per register phase. Program the direction the shield faces by turning this card to indicate front- back- right or left.','',6,-2,0,-1,68,6,8),
(49,'Superior Archive Copy','You may withdraw your next archive copy undamaged- even if you discard this option when you robot is destroyed.','',1,-2,0,-1,79,0,9),
(50,'The Big One ([quantity])','When activated- place a Big One token in your robot\'s square. At the beginning of the next turn- The Big One explodes.','',3,1,64,-1,92,4,7),
(51,'Tractor Beam','You now have the option of firing a tractor beam instead of your robot\\\'s main laser. The tractor beam will pull a target robot 1 square toward you. The beam may not be used if the target robot is in an adjacent square.','',8,-2,0,-1,21,2,5),
(52,'Turret ([direction])','Your robot now has a turret for its main laser and optional weapons. Program the direction the turret faces by turning this card to indicate front- back- right or left.','The turret will also affect the direction of the rear laser',6,-2,0,-1,32,6,8),
(53,'Explosive Laser ([quantity])','Your robot has an optional Explosive Laser.  When fired, target robot will receive 2 points of explosive damage.','Custom SRR Option',4,2,2,-1,94,4,8),
(55,'Point Sucker','When your robot fires it\'s main laser, you can remove points from the target','Custom SRR Option',2,1,0,-7,76,0,8),
(56,'EMP ([quantity])','When activated, your robot will transmit an EMP before Phase 1, locking in your program and clearing the programs for all other robots.  Your robot will play out its program, then reset for one turn to clear the locked program.  No damage will be added or cleared by the EMP.','Custom SRR Option',4,1,0,-1,97,0,8),
(57,'Damage Eraser ([quantity])','Before Phase 1, all damage is erased from your robot','Custom SRR Option',4,1,0,-1,56,0,8),
(58,'Reboot','Your robot will immediately shut down and repair all damage','Custom SRR Option',10,-1,0,-1,90,0,8),
(59,'Additional Laser ([quantity])','Your robot\'s main laser has been modified to fire an additional shot. May be used with {Fire Control} and/or {High Power Laser.}','Custom SRR Option',1,1,0,-1,82,0,8);
